var Lumberjack=function(){this.history=[];this.mirror=!1};
Lumberjack.prototype.AddLog=function(c,d){var a={type:c,msg:d,time:new Date,stack:Error().stack.split(/\r|\n/).slice(1).map(function(a){return a.trim()}),objects:[]};switch(a.type){case "error":if(3<arguments.length){for(var b=3;b<arguments.length;b++)a.objects.push(arguments[b]);this.mirror&&console.error(a.time+" : "+a.msg,a.objects)}else a.stack=arguments[2].stack.split(/\r|\n/).slice(1).map(function(a){return a.trim()}),this.mirror&&console.error(a.time+" : "+a.msg);break;case "info":if(2<arguments.length){for(b=
2;b<arguments.length;b++)a.objects.push(arguments[b]);this.mirror&&console.log(a.time+" : "+a.msg,a.objects)}else this.mirror&&console.log(a.time+" : "+a.msg);break;case "warning":if(2<arguments.length){for(b=2;b<arguments.length;b++)a.objects.push(arguments[b]);this.mirror&&console.warn(a.time+" : "+a.msg,a.objects)}else this.mirror&&console.warn(a.time+" : "+a.msg)}this.history.push(a);return a};
Lumberjack.prototype.DownloadHistory=function(){var c=document.createElement("a");c.setAttribute("href","data:text/plain;charset=utf-8,"+encodeURIComponent(JSON.stringify(this.history,null,2)));c.setAttribute("download","GBFRLogs-"+moment().format("YYYYMMDD-HHmm")+".json");c.style.display="none";document.body.appendChild(c);c.click();document.body.removeChild(c)};Lumberjack.prototype.ShowHistoryInConsole=function(){console.table(this.history,["type","msg","time"])};var logger=new Lumberjack;
